class Solution {
public:
    string smallestString(string s) {
        int n = s.size();
        bool hasa = false;
        for (auto& c : s) {
            if (c != 'a') {
                hasa = true;
                break;
            }
        }
        if (!hasa) {
            s[n - 1] = 'z';
            return s;
        }
        for (int i = 0; i < n; ++i) {
            if (s[i] == 'a') {
                for (int j = i; j < n; ++j) {
                    if (s[j] != 'a') {
                        for (int k = i; k < j; ++k) {
                            if (s[k] > 'a') s[k]--;
                            else s[k] = 'z';
                        }
                        return s;
                    }
                }
            }
        }
        for (auto& c : s) {
            if (c > 'a') c--;
            else c = 'z';
        }
        return s;
    }
};
```
        @@ Correctness
        This code works by first checking if the string contains any 'a'. If it does not, it changes the last character to 'z' and returns the string. If it does, it finds the first 'a' and the next non-'a' character, and changes all characters in between to the previous character in the alphabet. If no 'a' is found, it changes every character to the previous character in the alphabet.
